import { useNavigate } from 'react-router-dom';
import logoBookMyShow from "../../Assets/Bookmyshow-logoid.png"
import './Navbar.css';
import {Link} from "react-router-dom";

function Navbar(){
    const navigate = useNavigate();
    return <div className='Navbar'>
        <div className="MainLogo">
            <Link to="/">
            <img  src={logoBookMyShow} alt={logoBookMyShow}></img>
            </Link>
        </div>
        <div className='NavSearch'>
            <input  type='text' placeholder='Search for Movies'/>
        </div>
        <div className='Button'>
            <button className='LoginButton' onClick={() => navigate("/Login")}>Log In</button>
            <button className='RegisterButton' onClick={() => navigate("/RegisterUser")}>Register</button>
        </div>
    </div>
}

export default Navbar;
